import React, { Component } from 'react';
import '../../assets/css/home/genericHome.css';

class OtherContentsIdentifire extends Component {
    constructor(props) {
        super(props)
        this.state = {

        }
    }

    render() {
        const { contents } = this.props;
        let subType = contents.sub_type;
        
        console.log("from Contetns Indentifire : ",contents);
       
        if (!contents.data) return (<div> {contents.title} </div>);

        if (subType === 'video') {
            return (
                <div>
                    {contents.data.map((contetn, id) => (
                        <div key={contetn.id} className='card mb-1'>
                            <div className='card-body p-3'>
                                <img className='home-center-series-videos-large'
                                    src={contents.thumb_image} alt="no Iamge" />
                                <div className="home-center-videos-title">
                                    {contents.title}
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
            );
        }

        if (subType === 'news')
            return (
                <div className='card'>
                    <div calssName='card-title'>
                        {contents.title}
                    </div>
                </div>

            );

        if (subType === 'article')
            return (
                <div className='card'>
                    <div calssName='card-title'>
                        {contents.title}
                    </div>
                </div>

            );
    }
}

export default OtherContentsIdentifire;
